mapper.select:
select 

,

from TFSTRX
where BRANCH = #{BRANCH}
  and COMP_CODE = #{COMP_CODE}
  and LC_TYPE = #{LC_TYPE}
  and TRX_NBR = #{TRX_NBR}
  and TRX_TYPE = #{TRX_TYPE}

mapper.delete:
delete from TFSTRX
where BRANCH = #{BRANCH}
  and COMP_CODE = #{COMP_CODE}
  and LC_TYPE = #{LC_TYPE}
  and TRX_NBR = #{TRX_NBR}
  and TRX_TYPE = #{TRX_TYPE}
